import React, { useState } from 'react';

function ISMModule({ ismRecords, setISMRecords }) {
  const [formData, setFormData] = useState({
    ismEventType: "",
    ismDescription: "",
    ismAction: "",
    ismStatus: "pending",
    date: new Date().toISOString().slice(0, 16) // Date/heure actuelle
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const newRecord = {
      id: Date.now(),
      ...formData,
    };

    setISMRecords((prev) => [...prev, newRecord]);

    // Réinitialiser le formulaire
    setFormData({
      ismEventType: "",
      ismDescription: "",
      ismAction: "",
      ismStatus: "pending",
      date: new Date().toISOString().slice(0, 16),
    });
  };

  const handleDelete = (id) => {
    setISMRecords((prev) => prev.filter((record) => record.id !== id));
  };

  return (
    <div className="space-y-6">
      {/* Formulaire ISM */}
      <form onSubmit={handleSubmit} className="space-y-6">
        <div className="form-group">
          <label htmlFor="ismEventType">Type d'événement ISM</label>
          <select
            name="ismEventType"
            id="ismEventType"
            value={formData.ismEventType}
            onChange={handleChange}
            required
          >
            <option value="">Sélectionnez un type</option>
            <option value="incident">Rapport d'incident</option>
            <option value="nonConformity">Non-conformité</option>
            <option value="observation">Observation</option>
            <option value="exercise">Exercice/Simulation</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="ismDescription">Description</label>
          <textarea
            name="ismDescription"
            id="ismDescription"
            value={formData.ismDescription}
            onChange={handleChange}
            rows="4"
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="ismAction">Action corrective</label>
          <textarea
            name="ismAction"
            id="ismAction"
            value={formData.ismAction}
            onChange={handleChange}
            rows="3"
          />
        </div>

        <div className="form-group">
          <label htmlFor="ismStatus">Statut</label>
          <select
            name="ismStatus"
            id="ismStatus"
            value={formData.ismStatus}
            onChange={handleChange}
            required
          >
            <option value="pending">En attente</option>
            <option value="resolved">Résolu</option>
            <option value="ongoing">En cours</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="date">Date</label>
          <input
            type="datetime-local"
            name="date"
            id="date"
            value={formData.date}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit" className="button primary">Ajouter</button>
      </form>

      {/* Liste des événements ISM */}
      <div>
        <h2 className="text-lg font-medium">Liste des événements ISM</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th>Type</th>
                <th>Description</th>
                <th>Actions Correctives</th>
                <th>Statut</th>
                <th>Date</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {ismRecords.map((record) => (
                <tr key={record.id}>
                  <td>{record.ismEventType}</td>
                  <td>{record.ismDescription}</td>
                  <td>{record.ismAction}</td>
                  <td>{record.ismStatus}</td>
                  <td>{record.date}</td>
                  <td>
                    <button onClick={() => handleDelete(record.id)} className="text-red-600">
                      Supprimer
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default ISMModule;
